import { FlexCol, PaddingX, Padding, FlexRow } from '../constants/style'
import { Fade, Slide } from 'react-reveal';
import Pulse from 'react-reveal/Pulse';
import { Link } from 'react-router-dom'; 
import { useNavigate } from 'react-router-dom';

export default function Home() {

  return (

    //bg-background에서 background는 tailwind.config.js에서 설정했습니다
    //font-Gangwon은 index.css에 정의했습니다

    <div className={`${FlexCol} bg-background font-Gangwon relative z-0 h-screen`}>
        <p className={`text-white text-[100px]`}>진짜 떡볶이</p>
        <button className={`bg-yellow w-1/3 rounded-[45px] pt-10`}>
           <p className={'font-Gangwon text-[100px]'}>주문하기</p>
        </button>
    </div>
  )
}
